import './App.css';
import React from 'react'
import Main from './components/Main.js'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import RestrictionsPage from "./components/RestrictionsPage.js"

function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <Main></Main>
                </Route>
                <Route path="/restrictions">
                    <RestrictionsPage></RestrictionsPage>
                </Route>
            </Switch>
        </Router>
    )
}

export default App;
